    <h1>DeepLogic V9 - Tool Dự Đoán Tài Xỉu MD5 Go88</h1>
    <p>Dán mã MD5 vào đây để tool phân tích:</p>
    <textarea id="md5Input" placeholder="Dán mã MD5..."></textarea><br>
    <button onclick="analyzeMD5()">Dự Đoán</button>
    <div class="result" id="result"></div>

    <script>
        function analyzeMD5() {
            const md5 = document.getElementById("md5Input").value.trim().toLowerCase();
            if (md5.length !== 32 || !/^[0-9a-f]+$/.test(md5)) {
                document.getElementById("result").innerText = "❌ Mã MD5 không hợp lệ!";
                return;
            }
            const firstByte = parseInt(md5.slice(0, 2), 16);
            const secondByte = parseInt(md5.slice(2, 4), 16);
            const thirdByte = parseInt(md5.slice(4, 6), 16);
            const total = firstByte + secondByte + thirdByte;
            const result = total % 2 === 0 ? "🎲 Dự đoán: TÀI" : "🎲 Dự đoán: XỈU";
            document.getElementById("result").innerText = result;
        }
    </script>
